import React from "react";
import ''
//thieu active , neu true thi co border , false thi k
const RenderNavbar =(props)=>{
    return(
        <div className="icon">
            <i className= {`fa ${props.icon}`}  aria-hidden="true"> {props.type}</i>
        </div>
    )
};

export default RenderNavbar;
